import "./setgame.css";
/* <!--Game Picture --> */
import pacman from "../../assets/LogoGame/pacman.png";
/* <!--Game Link --> */

const Pacman = () => {
    return (
    <div className='game-container'>
        <img className='game-avatar' src={pacman}/>
            <label className='game-label'/>

    </div>    
          
    );
};
export default Pacman;
